    public static int lengthOfLongestSubstring(String s) {
        int longest = 0;
        int length = s.length();
        int start = 0;
        int restart = 0;
        Map<Character, Integer> charPositions = new HashMap<Character, Integer>();
        while ((length - start) > longest) {
            int i = restart;
            int duplicatePosition = -1;
            while (i < length) {
                char c = s.charAt(i);
                if (charPositions.containsKey(c)) {
                    duplicatePosition = charPositions.get(c);
                    break;
                } else
                    charPositions.put(c, i);
                i++;
            }

            if (charPositions.size() > longest)
                longest = charPositions.size();

            if (duplicatePosition >= 0) {
                //clean up the map
                int charsToAdd = i - duplicatePosition;
                int charsToRemove = duplicatePosition - start;
                if (charsToAdd < charsToRemove) {
                    charPositions.clear();
                    for (int j = duplicatePosition + 1; j < i; j++) {
                        charPositions.put(s.charAt(j), j);
                    }
                } else {
                    for (int j = start; j <= duplicatePosition; j++) {
                        charPositions.remove(s.charAt(j));
                    }
                }
                start = duplicatePosition + 1;
                restart = i;
            } else
                break;
        }

        return longest;
    }

